import React from 'react'
import styled from "styled-components";



const Profile = () => {
    return (
        <Body>
            
        <l class="fas fa-user-circle"></l>
        <h1>User name</h1>
        </Body>
    )
};
const Body =styled.main`
l{ font-size:921%;
    margin-left: 232px;
    margin-top:63px;
    display:flex;
    flex-direct
    cursor: pointer;
}
h1{
    margin-top:34px;
   
    
    margin-left: 342px;

}



`




export default Profile
